  \"2016-07-27T22:45:42.699791\",\n\t\"name\": \"narrative-report-january-february-march-april-1950-des-lacs-national-wildlife-refuge-lostw\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Des Lacs National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1950.
  The report begins by summarizing the weather conditions, water conditions, and food
  and cover during this period. Wildlife- including migratory birds, upland game birds,
  big game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
  The Refuge development and maintenance section discusses physical developments,
  plantings, collections and receipts, and wildfires. Resource management is outlined;
  topics include grazing, haying, and fur harvesting. The public relations section
  of the report describes recreational uses, Refuge visitors, and Refuge participation.
  N-R forms and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
